import React from 'react';
import styled from 'styled-components';
import banner from '../images/productsbg.jpg';

const Products = () => {
	return (
		<ProductsWrapper>
			<div className='banner'>
				<img src={banner} alt='' />
			</div>
			<div className='products-title'>
				<h3>
					<span>Pro</span>ducts
					<p className='ball1'></p>
					<p className='ball2'></p>
					<p className='ball3'></p>
					<p className='ball4'></p>
					<p className='ball5'></p>
					<p className='ball6'></p>
					<p className='ball7'></p>
				</h3>
			</div>
		</ProductsWrapper>
	);
};

export default Products;

const ProductsWrapper = styled.section`
	position: relative;
	top: 70px;
	.banner {
		width: 100%;
		height: 250px;
	}
	.banner img {
		width: 100%;
		height: 100%;
	}
	.products-title {
		// font-family: 'Poppins';
		margin: 2rem auto;
		text-align: center;
		color: blue;
		width: 150px;
	}
	h3 {
		position: relative;
		font-weight: 800;
	}
	span {
		text-transform: uppercase;
	}
	p {
		width: 50px;
		height: 50px;
		border-radius: 50%;
		background: cornflowerblue;
		margin: 0;
		padding: 0;
		position: absolute;
		transform: skew(-30deg);
		z-index: 1;
		opacity: 0.7;
		top: -2000%;
	}
	p:nth-child(odd) {
		background: red;
		opacity: 0.4;
		transform: skew(30deg);
	}
	.ball1 {
		top: 0px;
		right: 10%;
	}
	.ball2 {
		top: 0px;
		left: 10%;
	}
	.ball3 {
		top: 0;
		right: 30%;

		background: green;
		transform: rotate(90deg);
	}
`;
